import React, { Component } from 'react'
import { useState } from 'react'

export default class AddStudent extends Component {
    constructor(props){
        super(props);
        this.state = {
            name: '',
            mail: '',
            description: '',
        };
    }

    render() {
        return (
            <form>
                <h3>Dodaj nowego studenta</h3>

                <input type="text"
                    placeholder='Imie'/>

                <input type="text"
                    placeholder='Opis'/>

                <input type="text"
                    placeholder='Email'/>

                <input type="text"
                    placeholder='Tagi'/>

            </form>
        )
    }
}
